You can use a single state variable to keep track of the currently open tooltip. Then, when a new tooltip is opened, you can close the previous one.

```
import React, { createContext, useContext, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [currentTooltip, setCurrentTooltip] = useState(null);

  const openTooltip = (text) => {
    setCurrentTooltip(text);
  };

  const closeTooltip = () => {
    setCurrentTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ currentTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
