I'm glad to help you create a simple Chrome extension that takes screenshots of a webpage and saves them to a file. Here's a step-by-step guide to create this extension:

1. **Create a new directory** for your extension and navigate into it.

2. **Create a manifest file**: Create a new file named `manifest.json` and add the following content:

```json
{
  "manifest_version": 2,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "description": "Takes a screenshot of the current webpage",
  "permissions": ["activeTab", "downloads"],
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "icons": {
    "48": "icon.png"
  }
}
```

3. **Create a popup**: Create a new file named `popup.html` and add the following content:

```html
<!DOCTYPE html>
<html>
  <head>
    <script src="popup.js"></script>
    <style>
      button {
        height: 30px;
        width: 100px;
      }
    </style>
  </head>
  <body>
    <h1>Webpage Screenshot</h1>
    <button id="capture">Capture</button>
  </body>
</html>
```

4. **Create a popup script**: Create a new file named `popup.js` and add the following content:

```javascript
document.getElementById('capture').addEventListener('click', () => {
  chrome.tabs.captureVisibleTab(null, {}, dataUrl => {
    const link = document.createElement('a');
    link.download = 'screenshot.png';
    link.href = dataUrl;
    link.click();
  });
});
```

5. **Create a background script**: Create a new file named `background.js` and leave it empty for now.

6. **Create an icon**: Create a 48x48 pixel icon named `icon.png` in the extension directory. You can use any image editor to create this icon.

7. **Load your extension into Chrome**:

   a. Open Chrome and navigate to `chrome://extensions/`.

   b. Enable "Developer mode" by toggling the switch in the top right corner.

   c. Click the "Load unpacked" button and select your extension directory.

Your extension is now ready to use. Click on the extension icon in the toolbar, and you should see a "Capture" button. Clicking this button will take a screenshot of the current webpage and save it as a file named `screenshot.png` in your default downloads folder.

